<area shape="rect" id="id1" href="Join.html" title="Join is a pseudo-state which merges flow parallel execution branches. " alt="" coords="784,558,841,614">
<area shape="rect" id="id2" href="End.html" title="End is a final pseudo-state with only inputs and no outputs indicating completion of a flow. " alt="" coords="22,558,79,614">
<area shape="rect" id="id3" href="Fork.html" title="Fork is a pseudo-state which splits flow elements execution into parallel branches. " alt="" coords="1158,558,1219,614">
<area shape="rect" id="id4" href="Start.html" title="Start is an initial pseudo-state with only outputs and no inputs indicating start of a flow. " alt="" coords="1255,558,1317,614">
<area shape="rect" id="id5" href="Choice.html" title="Choice is a conditional pseudo-state." alt="" coords="115,558,191,614">
<area shape="rect" id="id6" href="InputPin.html" title="Input is a pseudo-state displayed as a square on the border of the containing parition flow through which calls initiate the flow. " alt="" coords="876,558,959,614">
<area shape="rect" id="id7" href="ExitPoint.html" title="Exit point is a pseudo-state displayed as a crossed circle on the border of the containing partition flow through which transitions leave the flow. " alt="" coords="401,558,487,614">
<area shape="rect" id="id8" href="OutputPin.html" title="Output pin is a pseudo-state displayed as a square on the border of the containing partition flow through which calls are made to other flow elements." alt="" coords="522,558,617,614">
<area shape="rect" id="id9" href="EntryPoint.html" title="Entry point is a pseudo-state displayed as a circle on the border of the containing partition flow through which transitions enter the flow. " alt="" coords="652,558,749,614">
<area shape="rect" id="id10" href="ExpansionInput.html" title="Expansion input is a pseudo-state which can be used instead of partition start pseudo-state to indicate that the partition flow input is a collection and the flow is executed for each element in the collection." alt="" coords="995,558,1123,614">
